(function() {
    'use strict';

    // Your code here...

    // 去除登录选中限制
    document.getElementById('content_views').id = 'content_views_new';

    // 去除关注提示挡板
    if(document.getElementsByClassName('hide-article-box')[0] != undefined){
        document.getElementsByClassName('hide-article-box')[0].hidden = true;
    }

    // 去除关注内容隐藏
    if(document.getElementById('article_content') != undefined){
        document.getElementById('article_content').style = '';
    }

    // 无用：去除复制携带版权文字
    document.addEventListener('copy', function(event) {
         e.preventDefault();
        event.clipboardData.setData('text', window.getSelection().toString());
        console.log('调用啦111~');
    });

    //增加复制弹窗
    document.addEventListener('mousedown',function(e){
	if(e.button==0){
			console.log('你按下了鼠标左键!');
		}else if(e.button==1){
			console.log('你按下了鼠标滚轮!');
		}else{
			console.log('您按下了鼠标右键!');
            var content = window.getSelection().toString();
            if(content != ""){
                prompt("自行复制以下内容:",window.getSelection().toString());
            }
		}
    });

    console.log('调用啦~');
})();